INSERT INTO `about_structure` (`id`, `full_name_la`, `full_name_en`, `position_la`, `position_en`, `responsible_la`, `responsible_en`, `image`, `structure_order`) VALUES
(4, 'ທ່ານ ຊານໄຊ ພົມສຸວັນ', 'ທ່ານ ຊານໄຊ ພົມສຸວັນ', 'ຜູ້ອຳນວຍການໃຫຍ່', 'ຜູ້ອຳນວຍການໃຫຍ່', '', '', '1709006514303.jpg', '1'),
(5, 'ທ່ານ ໄຊຊະນະ ພູນສະຫວັນ', 'ທ່ານ ໄຊຊະນະ ພູນສະຫວັນ', 'ຮອງຜູ້ອຳນວຍການ ອາວຸໂສ', 'ຮອງຜູ້ອຳນວຍການ ອາວຸໂສ', 'ຊີ້ນຳພະແນກຂາຍ ຊ່ອງທາງທະນາຄານ, ສິນເຊື່ອລົດ, ພັນທະມິດ ແລະ ພະແນກການຕະຫລາດ-ປະຊາສຳພັນ', 'ຊີ້ນຳພະແນກຂາຍ ຊ່ອງທາງທະນາຄານ, ສິນເຊື່ອລົດ, ພັນທະມິດ ແລະ ພະແນກການຕະຫລາດ-ປະຊາສຳພັນ', '1709006284703.jpg', '2'),
(6, 'ທ່ານ ທະວັດໄຊ ຈັນທະດີ', 'ທ່ານ ທະວັດໄຊ ຈັນທະດີ', 'ຮອງຜູ້ອຳນວຍການ', 'ຮອງຜູ້ອຳນວຍການ', 'ຊີ້ນຳພະແນກບໍລິຫານ ຊ່ອງທາງຕົວແທນ ແລະ ການຝຶກອົບຮົມ', 'ຊີ້ນຳພະແນກບໍລິຫານ ຊ່ອງທາງຕົວແທນ ແລະ ການຝຶກອົບຮົມ', '1709006526616.jpg', '3'),
(7, 'ທ່ານ ນາງ ພິທິຍາ ລິດທິຜາດ ', 'ທ່ານ ນາງ ພິທິຍາ ລິດທິຜາດ ', 'ຮອງຜູ້ອຳນວຍການ', 'ຮອງຜູ້ອຳນວຍການ', 'ຊີ້ນຳພະແນກ ບັນຊີ-ການເງິນ ແລະ ປະຕິບັດການ', 'ຊີ້ນຳພະແນກ ບັນຊີ-ການເງິນ ແລະ ປະຕິບັດການ', '1709006536201.jpg', '4');
